main_text:
[낙원테산도]
산도는 サンド를 말하는 것 같은데 테산도는 무슨 뜻이지? 오믈렛, 타마고산도, 카츠산도가 있는 메뉴를 보니 마음과마음이 떠올랐어. 커팅을 보기 위해서…는 아니고 빵보다 밥이 당겨서 오므라이스를 시켰는데, 오믈렛과 소스는 무난했지만 밥이 좀 아쉬웠음.

